			if(scope.descuento == 0){
			  scope.total = (scope.subTotal + scope.impuesto);
			}else{
			  scope.total = (scope.subTotal + scope.impuesto)-(((scope.subTotal + scope.impuesto) * scope.descuento)/100);
			}  
